// ResumeFormProject.js

import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ResumeFormProject({ resumeId }) {
  const [projectTitle, setProjectTitle] = useState('');
  const [projectContent, setProjectContent] = useState('');
  const [projectPeriodStart, setProjectPeriodStart] = useState('');
  const [projectPeriodEnd, setProjectPeriodEnd] = useState('');
  const [isInProgress, setIsInProgress] = useState(false);
  const [projects, setProjects] = useState([]);

  useEffect(() => {
    if (resumeId) {
      fetchProjects();
    }
  }, [resumeId]);

  const fetchProjects = async () => {
    try {
      const response = await axios.get(`/api/resumes/${resumeId}/projects`);
      setProjects(response.data);
    } catch (error) {
      console.error('Error fetching projects:', error);
    }
  };

  const handleProjectSubmit = async () => {
    try {
      await axios.post(`/api/resumes/${resumeId}/projects`, {
        project_title: projectTitle,
        project_content: projectContent,
        project_period_start: projectPeriodStart,
        project_period_end: projectPeriodEnd,
        is_in_progress: isInProgress
      });
      setProjectTitle('');
      setProjectContent('');
      setProjectPeriodStart('');
      setProjectPeriodEnd('');
      setIsInProgress(false);
      fetchProjects();
    } catch (error) {
      console.error('Error submitting project:', error);
    }
  };

  const handleDeleteProject = async (id) => {
    try {
      await axios.delete(`/api/resumes/${resumeId}/projects/${id}`);
      fetchProjects();
    } catch (error) {
      console.error('Error deleting project:', error);
    }
  };

  return (
    <div>
      <h2>PROJECT</h2>
      <div>
        <label>
          프로젝트명:
          <input type="text" value={projectTitle} onChange={(e) => setProjectTitle(e.target.value)} />
        </label>
      </div>
      <div>
        <label>
          부연설명:
          <input type="text" value={projectContent} onChange={(e) => setProjectContent(e.target.value)} />
        </label>
      </div>
      <div>
        <label>
          프로젝트 시작일:
          <input type="date" value={projectPeriodStart} onChange={(e) => setProjectPeriodStart(e.target.value)} />
        </label>
      </div>
      <div>
        <label>
          프로젝트 종료일:
          <input type="date" value={projectPeriodEnd} onChange={(e) => setProjectPeriodEnd(e.target.value)} />
        </label>
      </div>
      <div>
        <label>
          진행여부:
          <input type="checkbox" checked={isInProgress} onChange={(e) => setIsInProgress(e.target.checked)} /> 진행중
        </label>
      </div>
      <button onClick={handleProjectSubmit}>+</button>
      <h3>PROJECT 조회</h3>
      <ul>
        {projects.map((project) => (
          <li key={project.id}>
            <div>
              <strong>프로젝트명:</strong> {project.project_title}
            </div>
            <div>
              <strong>부연설명:</strong> {project.project_content}
            </div>
            <div>
              <strong>프로젝트기간:</strong> {project.project_period_start} ~ {project.is_in_progress ? '진행중' : project.project_period_end}
            </div>
            <button onClick={() => handleDeleteProject(project.id)}>X</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ResumeFormProject;
